import React, { Component } from 'react';
import logo from '../logo.png';
import './App.css';


class App extends Component {
  render() {
    return (
      <div className="Home">
        <div className="lander">
          <h1>Home page</h1>
          <p>A simple app showing react button click navigation</p>
          <form>
            <Button variant="btn btn-success" onClick={() => history.push('/Create')}>Click button to view products</Button>
          </form>
        </div>
      </div>
    );
  }
}

export default App;
